def rand_in_range(from, to)
  rand * (to - from) + from
end

def rand_price(from, to)
  rand_in_range(from, to).round(2)
end

def rand_time(from, to=Time.now)
  Time.at(rand_in_range(from.to_f, to.to_f))
end

def rand_page
  array = Array[0.25, 0.5, 1.0]
  array.sample
end

def rand_payment
  array = Array["Cash", "Credit", "Check"]
  array.sample
end

